jenkins:
  agentProtocols:
  - "Ping"
  authorizationStrategy:
    globalMatrix:
      permissions:
      - "Job/Discover:viewer"
      - "Job/Read:viewer"
      - "Job/Workspace:viewer"
      - "Overall/Administer:9930i"
      - "Overall/Administer:ayush"
      - "Overall/Administer:krishna"
      - "Overall/Read:authenticated"
      - "View/Read:viewer"
  crumbIssuer:
    standard:
      excludeClientIPFromCrumb: false
  disableRememberMe: false
  labelAtoms:
  - name: "built-in"
  - name: "master"
  - name: "slave"
  - name: "slaveLa1"
  labelString: "master"
  log:
    recorders:
    - name: "org.jenkinsci.plugins.periodicbackup"
  markupFormatter: "plainText"
  mode: NORMAL
  myViewsTabBar: "standard"
  nodeProperties:
  - envVars:
      env:
      - key: "MAVEN_OPTS"
  - envVars:
      env:
      - key: "MAVEN_OPTS"
  - envVars:
      env:
      - key: "MAVEN_OPTS"
  nodes:
  - permanent:
      labelString: "slaveLa1"
      launcher:
        ssh:
          credentialsId: "Jenkins Slave Creds LA1"
          host: "192.46.215.120"
          port: 22
          sshHostKeyVerificationStrategy: "nonVerifyingKeyVerificationStrategy"
          tcpNoDelay: false
      name: "slave"
      nodeDescription: "slave"
      nodeProperties:
      - envVars:
          env:
          - key: "MAVEN_OPTS"
      - envVars:
          env:
          - key: "MAVEN_OPTS"
      - envVars:
          env:
          - key: "MAVEN_OPTS"
      - envVars:
          env:
          - key: "MAVEN_OPTS"
      numExecutors: 2
      remoteFS: "/home/jenkins"
      retentionStrategy: "always"
  numExecutors: 1
  primaryView:
    all:
      name: "all"
  projectNamingStrategy: "standard"
  quietPeriod: 5
  remotingSecurity:
    enabled: true
  scmCheckoutRetryCount: 0
